'''
We are given .png file xored with iv. If we know starting bytes of png and xor it with our data we get IV
And since IV is constant self.newIV = hex(int(self.value, 16) - self.stup) we can just xor it with the rest of data
'''

from pwn import xor

data=bytes.fromhex("")

#this was the only clue to figuring out the iv
#the file was a .png image, which has its initial 16 bytes fixed more or less 
header=bytes.fromhex('89504e470d0a1a0a0000000d49484452')
enc_iv = xor(header, data[:16])
flag = xor(enc_iv, data) # Slow but I like it

with open('flag.png', 'wb') as flag_img:
    flag_img.write(flag)